(18, 'KPI-14', 'server uptime in hours for systems hosted in the data center', 'Percentage of server uptime in hours for systems hosted in the data center', 'Proportion of ICT equipment that is functional.', 'Server uptime focusing on the reliability and availability of your servers. Uptime of less than 99% calls for attention, and less than 95% calls for trouble', 'Server logs', 'Monthly', 1, 8, NULL, 100, 0),
(19, 'KPI-15', 'Patients satisfied with public health services', 'Patients satisfied with public health services', 'Percentage of patients a sampled geographical area that are satisfied with public health services delivery.', 'Percentage of patients a sampled geographical area that are satisfied with public health services delivery.', 'Opinion polls', 'Quarterly', 1, 9, NULL, 60, 0),
(20, 'KPI-16', 'Approved positions submitted', 'Percentage of approved positions that have been filled at the end of the quarter.  This will be broken down into MoH, NRH, RRH and district levels', 'Percentage of approved positions that have been filled at the end of the quarter.  This will be broken down into MoH, NRH, RRH and district levels', 'Percentage of approved positions that have been filled at the end of the quarter.  This will be broken down into MoH, NRH, RRH and district levels', 'Responsible Officer (s): Data coming from iHRIS manage', 'Annual', 2, 10, NULL, 85, 0),
(21, 'KPI-17', 'Staff accessed on payroll and paid salary and pension', 'Percentage of staff accessed on payroll and paid salary and pension', 'The indicator measures staff who are being paid by GoU', 'The indicator measures staff who are being paid by GoU', 'A/C HRM. Data from IPPS & IFMIS', 'Quarterly', 2, 10, NULL, 100, 0),
(22, 'KPI-18', 'Percentage of Wage bill utilized', 'Percentage of Wage bill utilized', 'Percentage of wage being consumed on Monthly, Quarterly, Bi-Annually, annually basis.', 'Percentage of wage being consumed on Monthly, Quarterly, Bi-Annually, annually basis.', 'Responsible Officers: HRM', 'Quarterly', 2, 10, NULL, 100, 0),
(23, 'KPI-19', 'Staff who have completed performance agreements and appraisal forms', 'Percentage of staff U2 and above who have completed performance agreements and staff below U2 who have filled appraisal', 'Percentage of staff U2 and above who have completed performance agreements and staff below U2 who have filled appraisal', 'Number of staff who submitted completed agreements and appraisal reports against Total Staff', 'Responsible Officers: HRM', 'Annual', 2, 10, NULL, 100, 0),
(24, 'KPI-20', 'Recommended rewards and sanctions that are implemented', 'Recommended rewards and sanctions that are implemented', 'Percentage of recommended rewards and sanctions that are implemented', 'number of recommended rewards and sanctions that are implemented divided by number of recommended rewards and sanctions', 'Responsible Officers: HRM', 'Annual', 2, 10, NULL, 100, 0),
(25, 'KPI-21', 'Proportion of staff attendance to duty', 'Percentage of staff reporting for duty on monthly basis', 'Percentage of recommended rewards and sanctions that are implemented', 'number of recommended rewards and sanctions that are implemented divided by number of recommended rewards and sanctions', 'Responsible Officers: HRM -IHRIS Manage', 'Monthly', 2, 10, NULL, 95, 0),
(27, 'KPI-22', 'Proportion of departments utilizing iHRIS', 'Proportion of departments utilizing iHRIS', 'Percentage of recommended rewards and sanctions that are implemented', 'number of departments with updated staff records against total number of departments', 'Heads of departments', 'Quarterly', 2, 10, NULL, 90, 0);
INSERT INTO `kpi_bkp` (`id`, `kpi_id`, `short_name`, `indicator_statement`, `description`, `computation`, `data_sources`, `frequency`, `subject_area`, `current_target`, `is_cumulative`) VALUES
(1, 'KPI-01', 'Finance Absorption Rate', 'Percentage of expenditure for funds released (absorption rate) (Cumulative)', 'The indicator measures the percentage of funds released to a vote that are spent within the quarter. Votes in scope are: MoH, Department, Program, Project.  \r\nPossible dimensions include source of funding \r\n', 'Numerator: Amount spent by the vote as at the end of a given completed quarter (X) Denominator: Amount released to a vote as at the end of a given completed quarter (Y) Computation will be: (X/Y) *100', 'IFMS, PBS, Assistant Commissioner Account MoH', 'Monthly', 1, 90, 0),
(2, 'KPI-02', 'Tranfer of subvention funds', 'Percentage of subvention funds transferred to affiliate institutions in time. (Cumulative)', 'The indicator measures the percentage of subvention funds that were transferred to MoH affiliate institutions in time within 3 weeks of warrant approval. Subvention refers to a grant of money in aid or support, mostly by the government.', 'Numerator: Subvention funds transferred (X) Denominator: Total subvention funds received by the MoH (Y) (X/Y) *100', 'IFMS PBS Assistant Commissioner Account MoH', 'Quarterly', 1, 80, 0),
(3, 'KPI-08', 'Wage absorption rate', 'Wage absorption rate', 'This refers to the extent to which the wage released for settling salaries of government health workers has been utilized in a given financial quarter', 'Numerator: Wage utilized for settling salaries of government health workers in each financial quarter. Denominator: Wage released for settling salaries of government health workers in a given financial quarter', 'IFMS, PBS, Assistant Commissioner/ Account MoH', 'Quarterly', 3, 100, 0),
(5, 'KPI-16', 'Depts timely submitting performance reports', 'Proportion of MoH Departments that submit performance reports on time', 'This indicator measures the percentage of MoH Departments that submit quarterly performance reports in time(One month following completion of the quarter).', 'Numerator: Number of MoH Departments that submit performance reports in time. Denominator: Number of MoH Departments.', 'Departmental plans and performance reports', 'Quarterly', 5, 100, 0),
(6, 'KPI-06A', 'Procurements initiated on time', 'Percentage of procurements initiated in time.', 'The indicator measures the percentage of procurements that were initiated in time.', 'Numerator: Number of procurements initiated in time. \r\nDenominator: Number of procurements initiated.\r\n', 'Procurement plan and tracker from MoH PDU.', 'Quarterly', 2, 80, 0),
(7, 'KPI-15', 'Hospitals with functional BoD', 'Proportion of referral hospitals with functional hospital boards', 'This indicator measures the percentage of Referral Hospitals (Regional and National) with functional hospital boards.  A functional hospital board is one that is fully appointed, meets periodically (at least Quarterly) and meeting minutes available for the quarterly meetings.', 'Numerator: Number of Referral Hospitals with functional hospital boards. Denominator: Number of Referral Hospitals.', 'Hospital Board Guidelines, Board Committee File, Board Minutes ', 'Quarterly', 5, 100, 0),
(8, 'KPI-03', 'Advances Accountability', 'Percentage of advances accounted in time. (Cumulative)', 'The indicator measures the percentage of subvention funds that were transferred to MoH affiliate institutions in time within 3 weeks of warrant approval. Subvention refers to a grant of money in aid or support, mostly by the government.', 'Numerator: Subvention funds transferred (X) Denominator: Total subvention funds received by the MoH (Y) (X/Y) *100', 'IFMS, PBS  Responsible Officer(s): Assistant Commissioner/ Account MoH', 'Quarterly', 1, 80, 0),
(9, 'KPI-14', 'Dept meeting held in the month', 'Proportion of departmental meetings held', 'The indicator measures the percentage of monthly departmental meetings held.  Each department is expected to hold at least one meeting a month.', 'Numerator: Number of departmental meetings held meetings in a specified period Denominator: Number of departmental meetings expected in a specified period', 'Meeting Minutes', 'Monthly', 5, 100, 0),
(10, 'KPI-13', 'TMC meetings held in the month', 'Proportion of Top Management Committee (TMC) meetings held', 'The indicator measures the percentage of TMC meetings held.', 'Numerator: Number of TMC meetings in a specified period Denominator: Number of months in the specific period ', 'Minutes', 'Monthly', 5, 100, 0),
(11, 'KPI-12', 'HPAC meetings held in the month', 'Proportion of the Health Policy Advisory Committee (HPAC) monthly meetings held ', 'The indicator measures the percentage of HPAC monthly meetings held. HPAC meetings are held at least once a month', 'Numerator: Number of HPAC monthly meetings held in a specified period. Denominator: Number of months in the specific period', 'HPAC Minutes ', 'Monthly', 5, 100, 0),
(12, 'KPI-11', 'TWGs meetings held in the month', 'Proportion of the Technical Working Group meetings holding monthly meetings', 'The indicator measures the percentage of TWGs that held the monthly meetings ', 'Numerator: Number of TWGs monthly meetings held in a specified period. Denominator: Number of TWGs monthly meetings expected in a specified period', 'TWG Minutes', 'Monthly', 5, 100, 0),
(13, 'KPI-17', 'Projects timely submitting reports', 'Proportion of MoH project that submit project reports on time', 'This indicator measures the percentage of MoH project that submit progress reports in time (One month following completion of the quarter).', 'Numerator: Number of MoH project that submit progress reports in time. Denominator: Number of MoH project with due reports.', 'Project plans, progress reports', 'Quarterly', 5, 100, 0),
(14, 'KPI-18', 'Integrated support supervision visists performed', 'Number of integrated support supervision field visits to RRHs and Districts conducted quarterly ', 'This indicator counts the number of integrated support supervision visits to the RRHs and Districts that were conducted during the Quarter. At least one visit should be conducted', 'Absolute count ', 'Support supervision plans and reports', 'Quarterly', 5, 100, 0),
(15, 'KPI-04', 'Financial reports submitted timely', 'Percentage of quarterly financial reports (PBS) submitted on time.', 'The indicator measures the percentage of quarterly reports that are submitted on time (due 30th day of the 1st Month of the following Quarter). This refers to submission of quarterly PBS reports to MoFPED.', 'Numerator: Number of financial reports that are submitted Denominator: Number of Expected quarterly financial reports  Computation will be: (X/Y)', 'PBS', 'Quarterly', 1, 100, 0),
(17, 'KPI-06B', 'Procurements successfully completed in time.', 'The indicator measures the percentage of procurements that are completed successfully in time.', 'The indicator measures the percentage of procurements that are completed successfully in time.', 'Numerator: Number of procurements successfully completed in time.  Denominator: Number of expected procurements to be completed.', 'Procurement plan and tracker from MoH PDU.', 'Quarterly', 2, 80, 0),
(18, 'KPI-19', 'Submission of weekly surveillance reports', 'Proportion of weekly surveillance reports submitted on time', 'This indicator measures the percentage of weekly surveillance reports that are submitted on time (as flagged in the DHIS2) by facilities', 'Numerator: Number of facilities submitting the weekly surveillance reports on time\r\n\r\nDenominator: Total of facilities expected to submit weekly surveillance reports\r\n', 'DHIS2/HMIS', 'Monthly', 6, 100, 0),
(19, 'KPI-20', 'District submission of HMIS reports on time', 'Proportion of districts submitting  HMIS monthly reports on time. ', 'This indicator measures the percentage of districts that have submitted on time (as flagged in the DHIS2) at least ', 'Numerator: Number of districts submitting  HMIS monthly reports on time', 'DHIS2/HMIS', 'Monthly', 6, 100, 0),
(20, 'KPI-21', 'Completeness of monthly HMIS reports', 'Completeness of monthly HMIS Reports', 'This indicator measures how many facilities in the country submitted monthly HMIS reports as flagged in the DHIS2 system', 'Numerator: Number of facilities that submitted monthly HMIS reports\r\n\r\nDenominator: Number of facilities expected to submit monthly HMIS reports\r\n', 'DHIS2/HMIS', 'Monthly', 6, 100, 0);
